import React, { useState } from 'react';
import UrlBackEnd from "../../models/UrlBackEnd";
import UrlFrontEnd from "../../models/UrlFrontEnd";

class Register extends React.Component{

    componentDidMount() {
        document.title = 'Register';
    }

    subbmission = (event) => {
        let password =  document.getElementById('password').value;
        let password2 =  document.getElementById('password2').value;

        // let password =  document.getElementById('account-password').value;
        // let account_id =  document.getElementById('account-id').value;
        //
        // var xhttp = new XMLHttpRequest();
        // var data = [];
        // xhttp.onreadystatechange = function() {
        //     if (this.readyState === 4 && this.status === 200) {
        //     //Typical action to be performed when the document is ready:
        //         data = JSON.parse(this.responseText);
        //         alert(this.responseText);
        //     }
        // };
        // xhttp.open("POST", "http://localhost:8000/login/", true);
        // xhttp.send("account_password=" + password);

        // xhttp.send("account_id=" + account_id);

    }
    render() {
        const form =
            <div className="container-fluid">
                <div className="row mt-5 mb-5 justify-content-center">
                    <div className="col-5">
                        <div className="register-box">
                            <div className="register-logo">
                                <b>GoVersus</b>
                            </div>

                            <div className="card">
                                <div className="card-body register-card-body">
                                    <p className="login-box-msg">Register as a new membership</p>

                                    <p className="login-box-msg text-danger">Error message</p>

                                    <form action={UrlBackEnd + 'register/'} method="post">
                                        <div className="input-group mb-3">
                                            <input name="first_name" type="text" className="form-control" placeholder="First name" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-user"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <div className="input-group mb-3">
                                            <input name="last_name" type="text" className="form-control" placeholder="Last name" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-user"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <div className="input-group mb-3">
                                            <input name="birthday" type="date" className="form-control" placeholder="Birthday" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-calendar"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <div className="input-group mb-3">
                                            <input name="address" type="text" className="form-control" placeholder="Address" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-location-arrow"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <div className="input-group mb-3">
                                            <input name="email" type="email" className="form-control" placeholder="Email" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-envelope"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <br />
                                        <div className="input-group mb-3">
                                            <input name="password" id="password" type="password" className="form-control" placeholder="Password" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-lock"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <div className="input-group mb-3">
                                            <input id="password2" type="password" className="form-control"
                                                   placeholder="Retype password" required/>
                                                <div className="input-group-append">
                                                    <div className="input-group-text">
                                                        <span className="fas fa-lock"></span>
                                                    </div>
                                                </div>
                                        </div>
                                        <div className="row">
                                            <div className="col-8">
                                                <div className="icheck-primary">
                                                    <input type="checkbox" id="agreeTerms" name="terms" value="agree" required/>
                                                        <label htmlFor="agreeTerms" className="ml-1">
                                                             I agree to the <a href="#">terms</a>
                                                        </label>
                                                </div>
                                            </div>

                                            <div className="col-4">
                                                <button type="submit" onSubmit="submission()" className="btn btn-primary btn-block">Register
                                                </button>
                                            </div>

                                        </div>
                                    </form>

                                    <div className="social-auth-links text-center">
                                        <p>- OR -</p>
                                        <a href="#" className="btn btn-block btn-primary">
                                            <i className="fab fa-facebook mr-2"></i>
                                            Sign up using Facebook
                                        </a>
                                        <a href="#" className="btn btn-block btn-danger">
                                            <i className="fab fa-google-plus mr-2"></i>
                                            Sign up using Google+
                                        </a>
                                    </div>

                                    <a href={UrlFrontEnd + "login/"} className="text-center">I already have a membership</a>
                                </div>

                            </div>

                        </div>
                    </div>
                </div>
            </div>
        return (form);
    }
}

export default Register;
